import axios from "axios";

class GetResults {
  config = {
    baseURL: "http://localhost",
    port: 3002
  };
  constructor() {
    this.httpClient = axios.create({
      baseURL: `${this.config.baseURL}:${this.config.port}`
    });
  }

  getResults() {
    return this.httpClient
      .get("/")
      .then(response =>
        response.data
      );
  }
}

export default new GetResults();
